        self.SuggestedOrder = 0 #$$$$$
        self.LastOrderTime = 0 #$$$$$
        
        # Traffic
        self.RedBase = 0
        self.RedSafety = 0
        self.TOR = 0
        self.TOY = 0
        self.TOG = 0

        # Records
